def calEuclideanDistance(vec1,vec2):#,word2,model):

    vec1 = np.array(vec1)
    vec2 = np.array(vec2)


    dist = np.sqrt(np.sum(np.square(vec1 - vec2)))
    return dist


def cos(vector1,vector2):
    dot_product = 0.0
    normA = 0.0
    normB = 0.0
    for a,b in zip(vector1,vector2):
        dot_product += a*b
        normA += a**2
        normB += b**2
    if normA == 0.0 or normB==0.0:
        return None
    else:
        return dot_product / ((normA*normB)**0.5)

